"use strict";function load(){$("section .header").click(function(t){copyToClipboard($(t.target).data("target"))})}function copyToClipboard(t){var e=document.createElement("textarea");e.value="".concat(window.location.host,"#").concat(t),document.body.appendChild(e),e.select(),document.execCommand("Copy"),e.remove()}function toggleMenu(){var t=$(".menu > section:not(.content) > .topics")[0];t.classList.contains("active")?t.classList.remove("active"):t.classList.add("active")}